description:
Fathom: Cannon Hawke

English | CBR | 8 Issues

Genre: Action/Adventure, Fantasy, Science Fiction

Written by Olivia Chadha, J.T. Krul, Koi Turnbull and Michael Turner
Art by Koi Turnbull and Marcus To

Collects issues #0-5, Cannon Hawke: Prelude, and Cannon Hawke: Beginnings.

A fugitive on the run from the Council, Cannon travels to Japan with Akiko in an attempt to secure the one person who may have divulged information that led to the destruction of the Blue city of Saba... the &quot;Shark&quot;, Shalla Barnic. But, Shalla holds even more secrets, deadly secrets, and Cannon's internal struggle with Taras continues... A struggle that Cannon may not be able to win. How can Cannon hope to defeat a new enemy when he cannot even defeat one within himself? Cover by Michael Turner and colorist Peter Steigerwald.

